      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE NOT col0 - - CAST ( 86 AS INTEGER ) < CAST ( + + col1 AS REAL ) * + - CAST ( - 82 AS INTEGER ) * - - CAST ( NULL AS INTEGER ) + + col0 + col2 * col1;
  - name: tab0

outputs:
  - name: q9964.out
    data: |
